import React from 'react';
import {BsPlusCircle} from 'react-icons/bs'
const Schedule = ()=>{
    return (
        <>
        <div>
            <h2>Schedules</h2>
        </div>
        <h1>
            <BsPlusCircle/>
        </h1>
        </>
    )
}

export default Schedule;
